"announcement": "Thank you for shopping with us.  Summit Engraving Ltd features personalized engraved gifts and favors for every occasion.\r\n\r\nIn a Hurry? Check out our Quick-to-Ship Section.\r\n\r\nWedding, Birthday, Anniversary, Graduation, House Warming, Bon Voyage, Favors\r\n\r\nWe Specialize in: Personalized Wedding Gifts, Personalized Groomsmen Gifts, Personalized Bridesmaids Gifts, Personalized Picture Frames, and more\r\n\r\n☆¸¸.☆¸¸.☆ Thank you for shopping with us! ☆¸¸.☆¸¸.☆",
