"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for your order.\r\n\r\nIF YOU HAVE ORDERED A PERSONALIZED ITEM please make sure that you have provided the  information exactly in the order it should appear.  We will engrave your item exactly as you supply the information.   As a reminder for monogrammed items, traditional monograms use the following lettering: for the name John Fitzgerald Kennedy, the traditional monogram order would be j-K-f.\r\n\r\nBREAKAGE POLICY\r\n\r\nWe go to great lengths to be sure your purchase and products arrive safe and sound.  As shipping is completely out of our control, breakage does sometimes occur.\r\n\r\nALL DAMAGE CLAIMS MUST BE MADE WITH 48 HOURS OF DELIVERY SHOWN ON TRACKING NUMBER (usually USPS).\r\n\r\nWe will file a shipping claim on your behalf and work to get you a replacement as soon as possible.  PLEASE NOTE that ALL CARRIERS REQUIRE photographs of the packing material AND the damage items, SHOWING PERSONALIZATION, where applicable.  Work or replacement items cannot begin until we have required photographs.\r\n\r\nThank you for shopping at Summit Engraving.  We invite you to share your experience with the Etsy community by leaving your feedback.  We can help you make just about any idea a reality when it comes to custom engraved gifts and accessories.  \r\n\r\nSummitEngravingLtd.Etsy.com",
