"description": "Customize your Mini Liquor Bottles! These make perfect wedding, birthday, or party favors! This item can be ordered with the labels only or with the labels and empty bottles. Want this customized for a different occasion or in a different way? Just contact us and we would be happy to create a custom listing for you.\r\n\r\nFeel free to give us a call with any questions (888) 959-2870 M-F 9am - 5pm Central or send us a convo anytime!\r\n\r\nIF YOU CHOOSE THE LABELS ONLY OPTION:\r\n- Custom labels only - Mini bottles not included\r\n- The Labels are approximately 3&quot; wide x 1 7/8&quot; high. \r\n- Designed to fit Jack Daniels, Captain Morgan, Smirnoff, Jim Beam, and Southern Comfort. \r\n- These labels are printed on high quality vinyl and cut to fit over the original label. The vinyl labels have an adhesive back like a sticker. \r\n- Please compare these dimensions to your liquor bottle labels because bottles and labels may vary. \r\n- You should be able to purchase the mini bottles in bulk from your local liquor store.\r\n\r\nIF YOU CHOOSE THE LABELS AND EMPTY BOTTLES OPTION:\r\n- Custom 50 mL mini liquor bottle labels AND empty bottles. \r\n- This is for the labels and bottles only...liquor not included. \r\n- This kit is designed so that you can buy a large bottle of your favorite liquor or mix your own cocktail and use the included funnel to fill the empty mini bottles. Then just screw the included caps on the bottles, and apply the labels. No adhesive or glue required...just peel and apply like a sticker. This DIY option saves you money so you do not have to source mini bottles in bulk. \r\n- This DIY favor kit includes the following: Custom Labels, Empty 50 mL Plastic Bottles, Black Bottle Caps, Funnel\r\n\r\nTO ORDER:\r\nPlease send us the following information:\r\n- Birthday Person&#39;s First Name\r\n- What birthday they are celebrating\r\nOur labels are printed on high quality vinyl. The material we use is similar to that used to wrap race cars, billboards, and bumper stickers. The vinyl gives a smooth, waterproof finish second to none! Quality is our top priority and we wanted our products to be the best, which is why we&#39;ve taken our design to this level. The colors displayed on your monitor may be slightly different from the actual label.\r\n\r\nWHOLESALE INQUIRIES:\r\nLiquid Courage products are available in select boutiques throughout multiple countries. If you are interested in carrying our line in your retail space, please contact us for details.\r\n\r\nKEEP SHOPPING:\r\nhttp://www.etsy.com/shop/LiquidCourage\r\nhttp://liquidcourageflasks.com\r\n\r\nVINETTA MAE:\r\nBe sure to check out our other Etsy shop, Vinetta Mae! It is a monogram boutique with a full lineup of custom phone cases, canvases, prints, signs, and more! \r\nhttp://www.etsy.com/shop/VinettaMae\r\n\r\nThank you for visiting Liquid Courage!\r\nTyler & Amy Fisk",
