"shop_name": "TennesseeWoodShop",
"user_id": 17334816,
"creation_tsz": 1319933354,
"title": "Wood Cufflinks, Wood Tie Bars, Wood Pens, Wood Tie Tack",
"announcement": "We offer wood tie bars, wood tie tacks, wood cufflinks, and many other fine wood accessories for any occasion. We make everything in the shop from the finest woods on earth with our own two hands. \r\n\r\nWe specialize in meeting and exceeding your wedding needs. Whether its wedding favors for the bridal party or 10 pairs of cufflinks for your groomsmen and fathers, we have what you are looking for. We only use superior quality finishes, adhesives and hardware on the finest local and exotic rare woods on the earth. Many have come to us for their 5th wedding anniversary needs as well and have been thrilled with what we do for them. Contact us for something custom or feel free to purchase one of the listings as they are, whichever you prefer. \r\n\r\nNo templates, pre-designs, laser cutters or duplicators, just my wife and I and our tools. We are offering free shipping on everything in our shop now too! Thanks for looking!",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for your purchase! I will update you with tracking info (if available) as soon as possible. Please follow us on Instagram at @tennesseewoodshop as well as Facebook at facebook.com/tennesseewoodshop and Twitter at @TNWoodShop. Please check back often for new stuff and great deals. As always, most items ship for free! Have an awesome day!\r\n\r\n",
"digital_sale_message": null,
