"login_name": "rounddaddy",
"accepts_custom_requests": true,
"policy_welcome": "Thanks for stopping by! All items are made by hand, so no two items are identical. That’s the beauty of the handmade wood products!",
"policy_payment": "I accept PayPal and Direct Checkout (item won&#39;t be made until payment cleared). All payments are due within 48 hours. No cancellations accepted. All coupon codes must be entered at checkout, through Etsy&#39;s coupon code submission method. Adding coupon code to &quot;Notes to Seller&quot; section does not apply.\r\n\r\nYou now have a payment plan option. Below outlines the options...\r\n\r\nPayPal&#39;s Bill Me Later® plan:\r\n\r\n   Please visit the Bill Me Later® section after logging in to your account OR visit http://www.paypal.com/us/webapps/mpp/billmelater-productoverview for all up-to-date information on PayPal financing options.",
"policy_shipping": "I ship most items via USPS for free, whether you buy 1 or 100 items! I ship items usually with-in 5 business days of cleared payments. I will provide tracking info when applicable.\r\n\r\n Free overnight shipping is an upgrade that applies to orders totalling $300 or more, to the U.S., AFTER coupon codes and BEFORE shipping costs. Free shipping and free overnight upgrades are not available to international orders. Overnight upgrade is not available on any clock purchases.\r\n\r\n Please note that buyers are responsible for any and all duties and customs charges that may be incurred, as well as knowing customs regulations for your particular country. Buyers should know whether they must obtain any import permits or liscenses before purchasing. Buyer assumes responsibility for item(s) after being shipped out. If an item is returned because of unpaid customs charges or taxes, you must pay shipping and handling to have it resent to you. No refunds will be made.",
"policy_refunds": "GENERAL REFUND:\r\n\r\nYou must notify me with in 5 calendar days (day of delivery is the first day) of receiving item for a refund minus original shipping costs and return to stock fee of 30%. Please note, you will be responsible for return shipping. No refunds will be issued if you are unwilling to wait the full length of time specified as to shipping dates and production timeframes or if you are unhappy with USPS or UPS delivery timeframes.\r\n\r\n\r\nDEFECTS:\r\n\r\nDue to the handmade nature of every item, there is going to be variences with each peice. For instance, grain-lines will differ slightly in the wood, sometimes a lot; one earring may be slightly larger or thicker than the other or dangle down slightly farther; the wood on one item may appear a different shade on another.... These are not considered defects, but are considered marks of truly handmade. No two items are exact (though we do try!)... However, if an item is truly defective, please notify me as soon as possible and we will try to work things out as best as we can. I generally only will do a replacement of the item, but that is not a rule. Your satisfaction is top priority.\r\n\r\nUNDELIVERABLE PACKAGE: \r\n\r\nIf an item is returned to me as undeliverable, I will notify you with in 48 hours. I will request a new address to re-ship the item to you. If it was an error on my part, you will not be charged any additional shipping charges. If it was an error on your part, than I will have to charge a re-shipping fee, determined by MY original shipping costs, not the free shipping offer. I will notify you via Etsy Convo a minimum of 2 times on 2 different calendar days, but no more that 3 times on 3 different calendar days to try and obtain a new address. If I do not receive a response from you in 5 calendar days after the last convo, than the item will be returned to stock and you will be disqualified from having your item re-shipped or receiving a refund (as outlined above in REFUND). To get your item re-sent to you after the 5 calendar days, you will be charged a 25% storage fee, based on orginal purchasing price, plus shipping charges. You as the buyer are responsible to know your countries customs regulations. If an item is returned or seized due to customs violation, you assume responsibility and will not be eligible for refund.\r\n\r\n\r\nLOST PACKAGE:\r\n\r\nItems will be shipped via USPS and will have a tracking code. Once the item leaves my hands to the post office, you as the buyer assume responsibility for any lost items. I will cooperate as much as I can with you to rectify the situation. Please allow 60 days from orginal acceptance scan from USPS.com before pursuing a lost claim.",
"policy_additional": "CUSTOMIZATION:\r\n\r\nMost items can be custom ordered as regards to type of wood, metal color and profile. Custom orders should be the same price as a standard listing, however, some addition charges may apply due to customization (i.e. species of wood, metal upgrade, intricate profile, etc.). Please convo me for more details.\r\n\r\n\r\nLEGAL TALK:\r\n\r\nBy purchasing and/or aquisitioning, utilizing or acquiring any product(s) from Tennessee Wood Shop, you and/or any third party, assumes all responsibility for any product(s) use and handling and any bequest or benevolence on your and/or any third parties part or behave. You agree that Tennessee Wood Shop and it&#39;s owner and/or partners, Etsy Inc. and it&#39;s partners and PayPal Inc and it&#39;s partners are not liable for any and all mishandling, misuse or otherwise negligent or careless use of the product(s) in question by you and/or any third party. This includes, but not limited to, using any product(s) in an intentional or accidental, violent manner of any kind; using any product(s) on/in sensitive skin of you or another person; using any product(s) to violate the personal/moral/civil liberties, rights, ideas or preferences of another person; and ingesting any product(s) accidentally or intentionally. This is binding to all local, jurisdictional, state, country and international orders.\r\n\r\nTranslation of all the above for normal folks: \r\n\r\nYou agree and are responsible for anything you buy after I ship it to you.  \r\n\r\n\r\n\r\n© Tennessee Wood Shop - All rights reserved. All photos are Tennessee Wood Shop originals. Please do not copy anything in this shop. Thank you.",
