"announcement": "You see, all products are personalized with initials, graphics or anything you want. There is no setup or engraving fee. To personalize, at checkout in &quot;Notes to Seller&quot; type instructions and if you&#39;re including a graphic, provide an online link or e-mail it when we contact you. ",
