"creation_tsz": 1415110092,
"title": "Cool & Unique Laser Engraved Gifts for Every Occasion",
"announcement": "**Spring Sale, 10% off any purchase using coupon code SPRINGSALE10**\r\nLooking for that perfect gift for a hard to buy for Man?  You are in the right place.  Check out the Ultimate Man Shop&#39;s range of Cool & Unique gifts for Men.\r\nWe have gifts for Men in Weddings, at Birthdays, Christmas, Graduations, Retirements, Anniversaries, Fathers Day, Valentines Day and more.  Our turn around time is also very fast (3 to 5 days depending on the amount) so your Custom Engraved order will be with you in no time.  Have a Custom Order idea but can&#39;t see it in our shop?  No problem, just send us a message and we will see what we can do.\r\n**Please note, despite the shipping times being set to 1 - 2 weeks, our speedy turn around will have your order dispatched ASAP, usually 7 days.  During the busier times of the year (Christmas / Wedding Season), it can take longer but generally no more than 12 days - If you need something by a specific date just let us know and we will get it to you.**\r\n\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Hi there, thank you for stopping by, currently The Ultimate Man Shop is closed for Christmas Vacation whilst I am out of the country.  Thank you very much for your interest, all listings in the shop will be available again from January 9th 2015.  \r\n\r\nHave an awesome winter vacation!\r\n\r\nKindest Regards, \r\n\r\nJoe \r\nThe Ultimate Man Shop",
"sale_message": "Thank you for shopping with The Ultimate Man Shop.\r\n\r\nYour custom order will be made and posted ASAP.  \r\n\r\nWith Best Wishes,\r\n\r\nJoe, Richard, Samantha and Lily the Dog.\r\n(The Ultimate Man Shop Team)",
