"title": "Sprinkle Pottery Studio",
"announcement": "Welcome. The production of pottery has been a true pleasure and joy in my life. I have been making functional pottery for over 35 years. Occasionally venturing into decorative or Art pottery I always return home to functional. I believe the true enjoyment of life does not come from the big events, or the milestones we reach, but from the everyday, day in, day out, joys that we experience. So, I produce pottery for everyday life.  \r\n\r\n The style, look, claybody and glazes of the pieces I choose to produce, have changed many times over the years and will continue to so in the future. New and different pieces will be coming soon.",
