"description": "This Personalized Padrino Madrina Whiskey Rocks glass set for godparents is the coolest godparent gift for Baptisms, Christenings and First Communion!  Even so, I strongly recommend that visitors look at the shop before deciding - we have 25 different products with 15 different design options:\r\n\r\nPlease take a 10 second glance at our awesome product lineup:  http://www.GodparentBaptismGift.etsy.com\r\n\r\nSAVE MONEY!  Buy sets here https://www.etsy.com/shop/GodparentBaptismGift?section_id=15697060&ref=shopsection_leftnav_1\r\n\r\nWhat a perfect way to ask someone to be a godparent! Just imagine serving your godparent their favorite beverage with these, and then watch for the joy on their faces!\r\n\r\nThe rocks glasses are 11 ounces and the price includes customization with the names of your choice!\r\n\r\nPrice includes set of two rocks glasses with custom engraving.\r\n\r\nWhiskey Glass Set DETAILS:\r\nWhiskey Rocks glass set for godparents gift for baptism, first communion etched by Godparent Baptism Gift\r\n\r\n- Diameter: 3 3/8&quot;\r\n- Height: 3 1/2&quot;\r\n- Material: etched glass features Child&#39;s name, Godfather or Godmother and godparent&#39;s name\r\n\r\nWe use sandblasting to create a deep, permanent engraving that will not fade over time or with washing.\r\n\r\nWe ensure that the quality of the engraving is flawless.\r\nFor custom designs you don&#39;t see, please convo us.\r\n\r\nWe currently offer the following designs:\r\n\r\nGodfather\r\nGodmother\r\nGodparents\r\nNinong\r\nNinang\r\nPadrino\r\nMadrina\r\nPadrinos\r\nFairy Godmother (magic wand)\r\n\r\nHOW TO ORDER your personalized whiskey glasses: Thank you for reading &#39;how to order&#39;!   We&#39;ll can now spend more of our time making your gift extra special.... Thanks so Much!\r\n\r\nTo Order, Please Just Click &quot;The Add to Cart&quot; Button at the Top of the Page and Proceed to Checkout. Simply Enter the information needed (below) In the &#39;Notes&#39; Section During Checkout.\r\n\r\nInformation we need from you in NOTES: (Please: no more / no less :)\r\n\r\n1. Upper Text (the exact text you want to appear Above your chosen design\r\n2. Your design choice\r\n3. Lower text (the exact text you want to appear Below your chosen design\r\n4. when ordering two or more glasses, include a number for each glass to be personalized\r\n\r\n\r\nEXAMPLE ORDERS: \r\n\r\n********************\r\n\r\nIf you are ordering One glass:\r\n\r\nJustin&#39;s\r\nGodfather\r\nUncle Mike\r\n\r\n********************\r\n\r\nIf you are ordering more than One glass:\r\n\r\nGlass #1\r\nJustin&#39;s\r\nGodfather\r\nUncle Mike\r\n\r\nGlass #2\r\nJustin&#39;s\r\nGodmother\r\nAunt Sara\r\n\r\n********************\r\n\r\nFor custom designs you don&#39;t see, please convo us.\r\n\r\nVERY IMPORTANT:\r\n-Names like James will always be printed as James&#39;\r\n-Names like Anthony will always be printed as Anthony&#39;s\r\n-Any special processing requests, or desired delivery dates must be included in &quot;notes&quot; at checkout\r\n-All etching is done in English unless otherwise specified in the &quot;notes&quot; at checkout\r\n\r\nNote: Once we get your order, it is placed in production automatically so we cannot respond to orders that say things like, &quot;if you cannot deliver by xx date, please cancel my order.&quot; These orders will be made & shipped.\r\n\r\nVisit our shop policies for more information on purchasing from GodparentBaptismGift: https://www.etsy.com/shop/GodparentBaptismGift/policy",
