"title": "Personalized Christening & Baptism Gifts for Godparents",
"announcement": "Specializing in unique gifts for godparents! We create personalized glass beer steins, whiskey glasses, travel coffee mugs, engraved beer glasses and much more. The perfect communion, christening or baptism gifts for your godmother and godfather. Our gifts are the perfect way to ask the question &quot;will you be my godparent&quot;? \r\n\r\nWe make the highest quality godparent gifts in the world!  Our personalized glassware gifts are all sandblasted for a natural, superior quality look - never laser or grinding wheel etched which yields a mass produced factory made look.\r\n\r\nSee what our customers say in shop reviews https://www.etsy.com/your/shops/GodparentBaptismGift/reviews?ref=shop_info\r\n\r\nBaptism favors, first communions and christenings are all appropriate events for our variety of  perfect quality, customized glassware & ceramics.  Steins, Pint Glasses, Rocks Glasses, Coffee Mugs and Decanters are personalized and delivered faster than any provider in the world.... and they are all perfect, really!\r\n\r\nWe know that selecting a godparent gift is most often done within a week or two before the event.  That&#39;s why we do the artwork instantly upon receiving your order.  We then sandblast (etch) the glassware or personalize the ceramics with sublimation the very next day.  Our relationship with FedEx allows us to deliver anywhere in the U.S. within 2 to 7 business days (our standard shipping) at a very low cost.\r\n\r\nNote: Once we get your order, it is placed in production automatically so we cannot respond to orders that say things like, &quot;if you cannot deliver by xx date, please cancel my order.&quot;  These orders will be made & shipped.\r\n\r\nPlease look over our ABOUT page which describes some of the subtle differences between our unique designs.  \r\n\r\nCall us anytime at 775-848-2831  or visit us at http://www.GodfatherBaptismGifts.com\r\n\r\nAt your service,\r\n\r\nJohn (ManhattanDon)\r\n\r\nBack to my shop: http://www.GodparentBaptismGift.etsy.com\r\n\r\nVisit our shop policies for more information on purchasing from GodparentBaptismGift: https://www.etsy.com/shop/GodparentBaptismGift/policy",
