"announcement": "Check out our sister stores PrairiePosh108, where we have an eclectic colletion of vintage clothing and accessories,  and MainStMercantile106, where we carry everything vintage but the kitchen sink!\r\n\r\nChicken Coop Antiques & Country Collectibles - &quot;We&#39;re On The Trail To Great Antiques!&quot;\r\n117 W. Santa Fe Ave, Burlingame, KS\r\nPhone: 785/654-3232\r\nBusiness Hours: Tuesday thru Saturday 9-5.\r\nCheck us out on Facebook at &quot;Chicken Coop Antiques&quot;\r\n \r\nWell worth the drive to historic Burlingame!\r\nSouth out of Topeka - 11 miles west of Highway 75 & 56 Junction\r\nwww.destinationburlingameks.com \r\n\r\n",
