"policy_welcome": "Welcome to Chicken Coop Antiques & Country Collectibles. We are always on the search for fun, unique and good quality items that we can share with you, our customers. We strive to provide products and service that will give you “something to crow about.” ",
"policy_payment": "We accept paypal or Etsy direct checkout. We ask that you make payment at the time of purchase. We will not ship items until payment has been received and cleared. If payment is not received within 3 days, we will assume your order has been abandoned and the item will be re-listed.\r\n",
"policy_shipping": "All items are mailed through the US Postal Service and will have shipping confirmation and a tracking number provided. We will ship internationally -- First Class International if under 4 lbs, next cheapest alternative if over 4 lbs -- but no tracking number will be provided. We will wrap items carefully for shipping.",
"policy_refunds": "All sales are final and are sold as-is and as described. The items we sell are not new – they are “vintage” items and as such will have slight imperfections, discolorations or wear. We will do our best to detail any and all imperfections that we observe. Please read through the item description and view all the pictures provided for that item to get the best representation of what you will receive if purchased. As colors vary depending on lighting and computers, no returns will be accepted based on color discrepancies. In clothing and accessories, please base your buying decisions on the actual measurements provided instead of the stated size as sizes have changed over the decades. \r\n\r\nErrors or omissions in descriptions are unintentional, not made to mislead or deceive.  If there is a major discrepancy between our description plus pictures versus the item you received, we will allow you to return the item. We will do our best to wrap items sufficiently for shipping but we cannot be responsible for abuse by the post office. If a package comes damaged to you, please report this to your local post office. We do not accept returns for buyers remorse.\r\n\r\n&quot;IF&quot; a return is authorized, items must be returned within (5) days of receipt and in the same condition as sent. We will refund your purchase price minus all shipping cost within (5) days of receiving your returned items back. Refunds will be given in the form of a store credit and may be used once the item has been received back by us and is in the condition as stated.",
"policy_additional": "Reserve Lisings\r\nWe are happy to provide a reserve listing on items or bundles of items that a customer specifically requests or on international orders while we package and calculate the shipping cost. We normally have special requests completed within 24 hours. We will then give you 3 days (72 hours) to complete the purchase or the item will go back out for sale to the general audience.\r\n\r\nFeedback\r\nWhen you receive your merchandise, we encourage you to leave us feedback so we can continue to improve our service to our customers.",
