"description": "Flask, Wedding Flask, Groomsman Flask, Personalized Flask, Wedding Party, Custom Flask,\nGroomsmen Flask\n\n\nThis listing is for a FIVE 6 oz stainless steel flasks with a hand dyed engraved leather wrap.\n\n\nAdd a special engraved note on the backside of the flask - FOR FREE!!!\n\n\nEach flask comes in a cotton gift bag - No Need To Gift Wrap!!!\n\n\n\n-----------------------------------------------------------------------------------\n\nIMPORTANT NOTE ABOUT LEATHER FLASKS:\n\nOur handmade leather wraps are REMOVABLE for cleaning and filling of the flask.\n\nBefore buying a leather wrapped flask somewhere else, ask if the wrap is REMOVABLE.\nMost others are glued to the flask and will cause mold if cleaned in water. Water can also delaminate the wrap if it gets wet. \n\nOur handmade leather wraps do not have that problem!\n\n-----------------------------------------------------------------------------------\n\n\n\nEach leather wrap is hand dyed for a one of a kind, never duplicated design pattern, and is seal coated for years of use.\n\nThese wraps are NOT printed on vinyl or paper, but are engraved into the leather.\n\nThe wrap slides off the flask so you can clean the flask.\n\nWe have attached photo layouts of all our wedding flasks (scrollwork and oval), just let us know which design you want to use in the ORDER NOTES section.\n\nSome popular titles include:\n\nGROOM\nBESTMAN\nGROOMSMAN\nUSHER\nFATHER OF THE BRIDE\nFATHER OF THE GROOM\nBRIDE\nMAID OF HONOR\nMATRON OF HONOR\n\nbut we will engrave any title you want, so be creative!\n\n**************************\n\nIMPORTANT: Three letter monogram note:\n\nThe traditional three letter monogram is like this: First Name - Last Name - Middle Name.\nWe will engrave the monogram letters in the EXACT ORDER you provide them to us, so please enter three letter format as indicated above.\n\n\n**************************\n\n\n\nPlease do not be fooled by flask listings elsewhere with low flask costs and high shipping costs.\n\nWith us you will get quality handmade leather flasks, reasonable shipping costs and FREE BACKSIDE ENGRAVING!\n\n\nWe DO NOT buy our leather flasks ready-made, instead we hand cut, hand dye, engrave and assemble each and every leather wrapped flask ourselves!\n\nOurs leather wraps are truly HANDMADE in the USA!\n\n***************************************************************\n\nYou may see all our Flasks here:\nhttps://www.etsy.com/shop/KillorglinCreations?section_id=7864426&ref=shopsection_leftnav_5",
