"title": "Handmade & Monogrammed Gifts in Leather, Stone, Metal",
"announcement": "At Killorglin Creations, we manufacture unique monogrammed, custom gifts in stone, leather, wood, glass and metal.\r\n\r\nWe have gifts for individuals as well as wedding party gifts and favors - all handcrafted in our shop in Methuen, Massachusetts.\r\n\r\nAll items are custom made, so our average processing time is 12-15 days plus transit.\r\n\r\nPlease follow us on Twitter: @KCGiftware for COUPON CODES and new product updates!\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "We are now in &quot;vacation mode&quot; and not accepting any new orders.  Since each item is a custom order, we need the time to make them.  \r\n\r\nDue to the amount of in house orders and the closeness of Christmas, we will not be accepting any new orders for Christmas deliveries.  We will reopen the store Wed Dec 17th, but any order placed then will not arrive by Christmas.\r\n\r\nAll orders that have already been placed are being worked on and will ship by Dec 18th, so if you have an order with us already, no need to check on it, we have it and it will be shipped by the 18th.  We always send the tracking number when an order ships.\r\n\r\nYou can still contact us through this Etsy email.\r\nDO NOT USE REGULAR EMAIL - ONLY THIS ETSY EMAIL SYSTEM.\r\n\r\nPlease understand that we are hard at work on your custom order, so please only contact us with important questions, as answering emails takes away from our production time.\r\n\r\nReference your ORDER DATE and the name of the person it is being SHIPPED TO.\r\n\r\n",
"sale_message": "We thank you for your order, and hope that you enjoy your purchase.\r\n\r\nFollow us on TWITTER for Coupon Codes and product updates:  @KCgiftware\r\n\r\nThank you,\r\nThe Ness&#39;\r\nKillorglin Creations",
"digital_sale_message": null,
"last_updated_tsz": 1432139124,
"listing_active_count": 415,
"login_name": "KillorglinCreations",
"accepts_custom_requests": true,
"policy_welcome": "At Killorglin Creations we make custom gifts, so delivery times vary based upon current workload.\r\n\r\nWedding season is very busy and as such, our normal times may be longer than other times of the year.  We try our best to work to tight deadlines and post our current timeframe on our front page.\r\n\r\nWe are very please to say we have not missed a deadline yet!",
"policy_payment": "We accept Paypal, Mastercard and Visa",
"policy_shipping": "When your order ships, you will receive a convo from us telling you how the package has shipped.\r\n\r\nWe determine if orders are shipping via US Mail or UPS depending on the weight and size of the object being shipped.  \r\n\r\nWhen we ship by UPS, we have a tracking number provided to us and we pass that number on to you via convo.\r\n\r\nWhen we ship via US Mail we most often receive a tracking number, but not always..  If you absolutely require a tracking number from the US Mail, please let us know in a convo prior to placing your order, and we will let you know if an extra fee applies.  \r\n\r\nWhen delivering to residences, it is UPS and the US Mail&#39;s policy to not require a signature.  Should you require someone to sign for the package(s) please let us know and we can let you know what the additional cost would be.\r\n\r\nThe addressee MUST BE KNOWN by the Post Office, UPS, FED-EX or other delivery service to reside at the address you are shipping to.  If the addressee is not known to reside there, you MUST address the label with a C/O (care of) someone that is known to reside there.\r\n\r\nIf you have us ship to an address, and the Post Office deems it to be UNDERLIVERABLE or UNDELIVERABLE AS ADDRESSED or some similar terminology, and we have addressed the package as you have instructed, our obligation has been completed at that point.  Should the package be returned to us, we will contact you with a new shipping price to re-mail it to you.  Should the package not be returned to us, or returned damage, we will not be responsible for any refund or replacement of any amount.\r\n\r\nLOST PACKAGES SHIPPED WITHIN THE UNITED STATES:\r\nIf your package does not arrive by the estimated date provided by the post office, UPS or other delivery service, we will decide to either replace or refund your purchase 14 business days, excluding holidays, after the delivery service&#39;s estimated delivery date.  The only exception would be FIRST CLASS MAIL, which would be 21 business days, excluding holidays.  This will be an allowable timeframe for misrouted packages to arrive to you.\r\n\r\nWe have had instances where packages delivered to apartment buildings were delayed as the mailman decided not to leave the package in the hallway unattended.\r\n\r\nWhen we send you the shipping convo, it would be a good idea to arrange to have the package delivered to a neighbor (leave a note for the mailman) or ask the post office to hold any packages at the post office for you to pickup.\r\n\r\nUPS WILL LEAVE packages unattended, so you should definately arrange to be home or leave a note for the UPS driver to deliver to a neighbor.  The neighbor would need to be a next door apt as UPS will not deliver to another building free of charge.\r\n\r\nCANADIAN and INTERNATIONAL shipments: If you require a tracking number, UPS is the only option. Please contact us to see if the shipping charges shown in the listing is for UPS or Mail. Any duties and taxes will be the responsibility of the customer.  Shipments made to Canada or Internationally by a service other than UPS (ie: Postal Service) are not guarranteed as the tracking numbers are only good until the package reaches the US border, then the receiving country takes control.\r\n\r\n\r\nINSURANCE:  \r\nAll shipments ARE NOT insured.  Should you require insurance for lost packages, damage, etc, let us know prior to placing your order so we may give you a price.  Any packages delivered to you in a damaged condition MUST be reported to the delivery person BEFORE YOU SIGN for the package.  Any damaged packages that have not been reported to the delivery person before you sign, will not be refunded or exchanged by us.",
"policy_refunds": "Our items are all made to order, so once an order has been entered and work begun there is no way of refunding your purchase should you decide to cancel.  Since we make custom items there is the returns for custom made items.\r\n\r\nShould there be a mistake made by us (Killorglin Creations) such as engraving mistake, wrong color, etc. you will need to send us photograph(s) clearly showing the problem.   If there is a damaged product, you will need to send us photograph(s) clearly showing the damage.  We can instruct you as to what we need for photographs based on the product.  If a refund is issued we may require a photo showing the product is no longer usable.  This would require a photograph showing the engraving or other part of the product marred, scratched or otherwise rendered unusable.  We do not want any of our products in use if thy are not up to our standards for quality.  We will instruct you how marr and photograph the item.\r\n\r\nPlease also see the above section for refund info.",
"policy_additional": "How to contact Killorglin Creations.\r\n\r\n***** ONLY use the ETSY convo system and NOT regular email. ****\r\n\r\nThe Etsy system ties all convos to the order and reduces miscommunications.\r\nAny requests MUST be sent through the Etsy system ONLY.  Regular emails may result in missed messages and will not be grounds for a refund.\r\n\r\n\r\nCOUPON CODES:  Only one coupon code may be used per purchase.  Coupon codes are only valid for RETAIL pricing.  Coupon Codes my not be used for WHOLESALE pricing.",
