"is_vacation": false,
"vacation_message": "Im afraid that the recent volume of orders has been overwhelming.  To continue delivering to my current customers within my promised timeframe, I have no choice but to shut down for a few days in order to catch up.  I will reopen on or before May 4th.\r\n\r\nWhen I reopen, the ship time will be 5 weeks. \r\n\r\nCobalt wood rings / Zirconium wooden rings can be rushed 21 days - $55) \r\n\r\nTitanium and wood rings can be rushed (15 days - $55) \r\n\r\nHand-wrought damascus styles ($475) are sold in very limited quantities per month and cannot be rushed!\r\n\r\n\r\n-------\r\n\r\nNotable Rings:\r\n\r\nhttp://www.wedgewoodrings.com/notable-rings/\r\n\r\n---------\r\n\r\nWe love the simplicity and beauty of natural wood rings. All WedgeWood Rings are handcrafted, sanded, and polished using wood that is carefully selected specifically for making rings. Each wooden ring is sized, made-to-order and unique. WedgeWood Rings are made of recycled woods or purchased from eco-conscious sellers. All rings are given multiple coats of a clear, durable finish to ensure the ring remains structurally sound and beautiful with minimal care on the part of the wearer. \r\n\r\nWedgeWood Rings get its name from the location of the original humble workshop: the basement of a house located in the South Wedge neighborhood of Rochester, NY.\r\n\r\nThanks for looking!\r\n\r\nWedgeWood Rings now has a blog! See whats new in the shop, get a preview of new woods, and see previously shipped orders. \r\n\r\nhttp://www.wedgewoodrings.com/",
"sale_message": "Below are some very important policies that I hope will not be relevant to your order (because they are only relevant when something is wrong). PLEASE READ THEM in any case.\r\n\r\n\r\nREGARDING RETURNS: Every ring is made to order, to the exact size you provide to me.  Rings with a wood interior can be adjusted up or down by about 1/4 size, but beyond that YOUR RING CANNOT BE RESIZED.  Refunds and exchanges will not be possible, as an entirely new ring will have to be made for you.  \r\n\r\n\r\nREGARDING MODIFICATIONS: When I receive an order, even though the ship date seems far off (in practice, I often ship early), work begins on your ring immediately.  Within 48 hours, the metal for your ring has very likely already been ordered, and perhaps has already been completed. For this reason, if you need to make a change (size, width, etc.) AFTER 48 hours, there will be a charge of $30.  \r\n\r\nThank you for reading.  This is obviously an automatically generated message.  If you have any questions please feel free to contact me through Etsy.  I respond fairly quickly.  If you find these policies overly draconian or otherwise problematic, please contact me as soon as possible so I can, with regret, cancel your order.\r\n\r\nBest,\r\nSteven Wyatt\r\nWedgeWood Rings",
